Now, we can add `OpMapper` by `CINN_REGISTER_OPMAPPER` macro like:

```
CINN_REGISTER_HELPER(sigmoid) { CINN_REGISTER_OPMAPPER(sigmoid, cinn::frontend::op_mappers::SigmoidOpMapper) }
```
And you must add `CINN_USE_REGISTER(sigmoid)` macor in  `use_op_mappers.h` header file, otherwise the new opmapper will link failed so that we cannot obtain register information. 

The `SigmoidOpMapper` is a function and it's Function prototype as following:
```
void SigmoidOpMapper(const paddle::cpp::OpDesc& op_desc, const OpMapperContext& ctx) {
   // check op right
  CHECK_EQ(op_desc.Input("X").size(), 1UL);
  CHECK_EQ(op_desc.Output("Out").size(), 1UL);

  // get input and output name
  auto x_name = op_desc.Input("X").front();
  auto out_name = op_desc.Output("Out").front();

  // get input variable by input name
  auto x   = ctx.GetVar(x_name);

  // get output variable returned by net builder
  auto out = ctx.builder_->sigmoid(x);

  // add to local variable map
  ctx.AddVar(out_name, out);

  // add to transform name map
  ctx.AddVarModelToProgramMap(out_name, out->id);
}
```

And we can get these registered op kernel by include `use_op_mappers.h` and using `OpMapperRegistry::Global()->Find(op_type)` function to get kernel. The `OpMapperRegistry` is inherited from `Registry` class and no new API added.

More Example see https://github.com/PaddlePaddle/CINN/pull/460 .

