This PR has done the following things:
1. Implement ApplySketchRule() in searchSpace to collect the new states that may be transferred to after applying several rules on a block from a certain state.

2. Use the above functions to realize two kinds of sketch generation methods, namely, pruning according to rules and random pruning in all possible transferred states. The original sketch generation method is retained.

Description of ApplySketchRule() :
The starting point of the change is the SearchState of one block selected, and subsequent changes will be made on this block. Every time a rule is selected, there are two choices: apply and not apply. Therefore, after several rules are selected consecutively, the state that may be transferred to constitutes a tree. The pruning operation starts from a node and deletes the branches that do not apply. This is because a better state is generated with a high probability after a rule is applied.
The interface is as follows:
```
  // @brief Collect the new states that may be transferred to after applying several rules on a block from a certain
  //    state.
  // @param state Starting point of state transition.
  // @param block_name Name of the block to apply the rules to.
  // @param rule_sampler Sampler that samples the new rule to apply on the block.
  // @param steps Number of steps to apply the rule.
  // @param prune_by_rule If true, prune the state transition tree by rule, otherwise prune randomly.
  // @param prune_probability Pruning probability of random pruning.
  std::vector<SearchState> ApplySketchRule(const SearchState& state,
                                                const std::string& block_name,
                                                RuleSampler* rule_sampler,
                                                int steps,
                                                bool prune_by_rule,
                                                double prune_probability = 1);
